import React from 'react'
import styled from 'styled-components'
import Photo from '../../../assets/img/photo/photo.jpg'
import { FlexWrapper } from '../../../components/styles-components/flexwrapper/FlexWrapper'

export const Hero = () => {
	return (
		<SectionHero>
			<FlexWrapper justify={'space-between'} align={'center'}>
				<div>
					<Title>Hi ðŸ‘‹ , <br></br>
						My name is Alex Ovsiannikov I build things for web</Title>
				</div>
				<PhotoImg src={Photo} alt={'Photo Alex Ovsiannikov'} />
			</FlexWrapper>
		</SectionHero>
	)
}

const SectionHero = styled.section `
	min-height: 100vh;
	display: flex;
	justify-content: center;
	flex-direction: column;
`

const Title = styled.h1 `
  font-weight: 700;
  font-size: 58px;
  line-height: 1.2069;
  letter-spacing: -0.02em;
  color: #d9d9d9;
`

const PhotoImg = styled.img`
  width: 100%;
  max-width: 350px;
  aspect-ratio: 1/1;
  object-fit: cover;
  border-radius: 230px;
`
